import { makeStyles } from '@material-ui/core/styles';

export default makeStyles({
  media: {
    height: 50,
    paddingTop: '56.25%',
    // backgroundColor: 'rgba(0, 0, 0, 0.5)',
    // backgroundBlendMode: 'darken',
  },
  border: {
    border: 'solid',
  },
  fullHeightCard: {
    height: '100%',
  },
  card: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
    borderRadius: '10px',
    height: '100%',
    position: 'relative',
  },
  overlay: {
    position: 'absolute',
    top: '20px',
    left: '20px',
    color: 'white',
  },
  overlay2: {
    position: 'absolute',
    top: '4px',
    right: '0px',
    color: 'gray',
  },
  grid: {
    display: 'flex',
  },
  details: {
    display: 'flex',
    justifyContent: 'space-between',
    marginLeft:'10px',
    marginBottom: '0px',
  },
  title: {
    marginLeft:'10px',
    marginBottom: '0px',
  },
  cardActions: {
    margin : '3px'
  },
});
